 import cl from   "./CheckBox.module.css"

export const CheckBox = ({value="stock"}) => {



  return (
    <>


    <div className="checkbox_container">
      <input type="checkbox" value={value} className={cl.checkbox}/>
      <label> {value} </label>
    </div>
    </>
  );
};
